import React from 'react';

const Signin = ()=>{
    return(
        <div>
            <div className="card">
               <h2>HOUX</h2>
               <input text="text" placeholder="email"/>
               <input text="text" placeholder="password"/>
               <button class="btn waves-effect waves-light">Login
  
                </button>
            </div>
        </div>
    )
}

export default Signin
